zKB9xUwNy	You can use Bootstrap classes to make your website/App responsive.	<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body style="font-size: 16px;">\n<p>[Skip if you already know bootstrap classes 😊]</p>\n<p>You can check the<strong> live code</strong> example here (change the screen size to see how bootstrap classes adapt to different screen sizes) --&gt;&nbsp; <strong><a href="https://codesandbox.io/s/trusting-darkness-zwn2y?file=/index.html" target="_blank" rel="noopener">https://codesandbox.io/s/trusting-darkness-zwn2y?file=/index.html:524-567</a></strong></p>\n<p>&nbsp;</p>\n<p>The Bootstrap 12 grid system can very conveniently make your website adaptable to all screen types ranging from phones to tabloids to laptops.</p>\n<p>&nbsp;You can use the <span style="background-color: #ecf0f1;"><code>.col-*</code> &nbsp;</span>classes to create grid columns for extra small devices mobile phones in portrait mode.</p>\n<p>The <span style="background-color: #ecf0f1;"><code>.col-md-*</code></span>&nbsp;classes for medium screen devices like tablets, the&nbsp;<span style="background-color: #ecf0f1;"><code>.col-lg-*</code></span>&nbsp;classes for large devices like desktops, and the&nbsp;<span style="background-color: #ecf0f1;"><code>.col-xl-*</code></span> classes for extra large desktop screens.</p>\n<p>&nbsp;</p>\n<p>For example, you can display two cards at a time on a bigger screen, but change the layout of the screen to a single card at a time when switched to a smaller screen</p>\n<p>&nbsp;</p>\n<p><img src="data:image/png;base64," width="531" height="346" />&nbsp; &nbsp;</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\n<p><img src="data:image/png;base64," width="535" height="338" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>You just need to enter these classes in your HTML code in the div class like this :&nbsp;</p>\n<pre class="language-markup"><code>    &lt;div class="col-10 col-md-4 col-sm-8"&gt;\n</code></pre>\n<p>&nbsp;</p>\n<p>To learn more checkout thier official documentation--&gt; <a href="https://getbootstrap.com/docs/4.0/layout/grid/" target="_blank" rel="noopener">https://getbootstrap.com/docs/4.0/layout/grid/</a></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n</body>\n</html>	t	0	2020-07-03 12:43:35.05+00	2020-07-04 14:07:19.318+00	hRDmJADBX	4LBaGgdaS	\N	\N	\N
