nq8cHxLYE	Java Program to Sort ArrayList of Custom Objects By Property	<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body style="font-size: 16px;">\n<pre class="language-java"><code>import java.util.*;\n\npublic class CustomObject {\n\n    private String customProperty;\n\n    public CustomObject(String property) {\n        this.customProperty = property;\n    }\n\n    public String getCustomProperty() {\n        return this.customProperty;\n    }\n\n    public static void main(String[] args) {\n\n        ArrayList&lt;Customobject&gt; list = new ArrayList&lt;&gt;();\n        list.add(new CustomObject("Z"));\n        list.add(new CustomObject("A"));\n        list.add(new CustomObject("B"));\n        list.add(new CustomObject("X"));\n        list.add(new CustomObject("Aa"));\n\n        list.sort((o1, o2) -&gt; o1.getCustomProperty().compareTo(o2.getCustomProperty()));\n\n        for (CustomObject obj : list) {\n            System.out.println(obj.getCustomProperty());\n        }\n    }\n}\n</code></pre>\n<p>&nbsp;</p>\n<p><strong>output</strong></p>\n<pre class="language-java"><code>A\nAa\nB\nX\nZ</code></pre>\n</body>\n</html>	t	0	2020-07-04 15:13:08.881+00	2020-07-04 15:13:08.881+00	HEr8YaUEf	hBJkVgyWU	\N	\N	\N
