u3CT3zLBg	Football DashBoard	<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body style="font-size: 16px;">\n<p># Football-League-Simulator</p>\n<p>You can use this project to simulate different football leagues from across the world using FIFA 20 stats.</p>\n<p>When you run main.py, matches between all the teams will be simulated week by week and the final output will look similar to this -&nbsp;<br />| &nbsp; &nbsp;| Club &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;| &nbsp; Matches Played | &nbsp; Wins | &nbsp; Draws | &nbsp; Losses | &nbsp; Points | &nbsp; GF | &nbsp; GA | &nbsp; GD |<br />|----|---------------|------------------|--------|---------|----------|----------|------|------|------|<br />| &nbsp;1 | Juventus &nbsp; &nbsp; &nbsp;| &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 38 | &nbsp; &nbsp; 31 | &nbsp; &nbsp; &nbsp; 1 | &nbsp; &nbsp; &nbsp; &nbsp;6 | &nbsp; &nbsp; &nbsp; 94 | &nbsp;113 | &nbsp; 32 | &nbsp; 81 |<br />| &nbsp;2 | Napoli &nbsp; &nbsp; &nbsp; &nbsp;| &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 38 | &nbsp; &nbsp; 26 | &nbsp; &nbsp; &nbsp; 6 | &nbsp; &nbsp; &nbsp; &nbsp;6 | &nbsp; &nbsp; &nbsp; 84 | &nbsp; 83 | &nbsp; 31 | &nbsp; 52 |<br />| &nbsp;3 | Inter &nbsp; &nbsp; &nbsp; &nbsp; | &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 38 | &nbsp; &nbsp; 26 | &nbsp; &nbsp; &nbsp; 5 | &nbsp; &nbsp; &nbsp; &nbsp;7 | &nbsp; &nbsp; &nbsp; 83 | &nbsp; 93 | &nbsp; 45 | &nbsp; 48 |<br />| &nbsp;4 | Milan &nbsp; &nbsp; &nbsp; &nbsp; | &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 38 | &nbsp; &nbsp; 23 | &nbsp; &nbsp; &nbsp;10 | &nbsp; &nbsp; &nbsp; &nbsp;5 | &nbsp; &nbsp; &nbsp; 79 | &nbsp; 68 | &nbsp; 25 | &nbsp; 43 |<br />| &nbsp;5 | Lazio &nbsp; &nbsp; &nbsp; &nbsp; | &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 38 | &nbsp; &nbsp; 20 | &nbsp; &nbsp; &nbsp; 7 | &nbsp; &nbsp; &nbsp; 11 | &nbsp; &nbsp; &nbsp; 67 | &nbsp; 82 | &nbsp; 57 | &nbsp; 25 |<br />| &nbsp;6 | Torino &nbsp; &nbsp; &nbsp; &nbsp;| &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 38 | &nbsp; &nbsp; 17 | &nbsp; &nbsp; &nbsp; 7 | &nbsp; &nbsp; &nbsp; 14 | &nbsp; &nbsp; &nbsp; 58 | &nbsp; 59 | &nbsp; 45 | &nbsp; 14 |<br />....</p>\n<p>___&nbsp;</p>\n<p>I have used a probalistic approach to simulate the events of the match-<br />For every minute in a match, the probability of a particular event occurring was calculated. The probabilities are then scaled according to the strengths of the teams and the match is simulated minute by minute.</p>\n<p>eg. The probabilities of different events for the 72nd minute -<br />```python<br />&nbsp;72: {'Away': {'Events': {'Attempt': 0.21580320536712636,<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 'Corner': 0.07957510249720462,<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 'Failed through ball': 0.03745806932538204,<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 'Foul': 0.23108460678345136,<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 'Free kick won': 0.23518449496831906,<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 'Hand ball': 0.01360417443160641,<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 'Key Pass': 0.15933656354826686,<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 'Offside': 0.03745806932538204,<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 'Own goal': 0.0003727171077152441,<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 'Penalty conceded': 0.0018635855385762206,<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 'Red card': 0.002422661200149087,<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 'Second yellow card': 0.0,<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 'Sending off': 0.0039135296310100634,<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 'Substitution': 0.1334327245620574,<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 'Yellow card': 0.049571375326127466},<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;'Probability': 0.48569876900796527},<br />&nbsp; &nbsp; &nbsp; 'Event': 0.011740589091071393,<br />&nbsp; &nbsp; &nbsp; 'Home': {'Events':{....}}}<br />```</p>\n<p>&gt; Such probabilities have been calculated for each minute from 0 to 100.&nbsp;<br />&gt; One or more events may occur in a single minute<br />As of 14/06/2020&nbsp;</p>\n<p>Top 5 Leagues are natively supported -<br />* English Premier League&nbsp;<br />* La Liga<br />* Seria A<br />* Bundesliga&nbsp;<br />* Ligue 1<br />#### Note: You can set up your own league by editing teams in odds.py and adding an option in main.py. Ensure that you use the correct name. eg. 'Man Utd' will not work , you will have to use 'Manchester United' because that is how it is stored. To see the list of valid team names, you can add the following in odds.py<br />```python<br />print(df['club'].unique())<br />#to playerlist.py and run it seperately<br />```<br />```python<br />league_options={'spain': {'name': 'La Liga Santander',<br />&nbsp; 'teams': ['Real Madrid',<br />&nbsp; &nbsp;'FC Barcelona',<br />&nbsp; &nbsp;'Valencia CF',<br />&nbsp; &nbsp;'Atl&eacute;tico Madrid',<br />&nbsp; &nbsp;'RC Celta',<br />&nbsp; &nbsp;'Real Betis',<br />&nbsp; &nbsp;'Villarreal CF',<br />&nbsp; &nbsp;'Real Sociedad',<br />&nbsp; &nbsp;'Athletic Club de Bilbao',<br />&nbsp; &nbsp;'Deportivo Alav&eacute;s',<br />&nbsp; &nbsp;'Getafe CF',<br />&nbsp; &nbsp;'Sevilla FC',<br />&nbsp; &nbsp;'Levante UD',<br />&nbsp; &nbsp;'Granada CF',<br />&nbsp; &nbsp;'CA Osasuna',<br />&nbsp; &nbsp;'Real Valladolid CF',<br />&nbsp; &nbsp;'RCD Espanyol',<br />&nbsp; &nbsp;'SD Eibar',<br />&nbsp; &nbsp;'RCD Mallorca',<br />&nbsp; &nbsp;'CD Legan&eacute;s']},<br />&nbsp; &nbsp;....<br />&nbsp; &nbsp;```<br />&nbsp; &nbsp;&gt;You can use your own custom list of teams and league name. There is no theoretical limit to the number of teams, but try to limit the number of teams to 100 and ideally try to have an even number of teams.</p>\n<p><br />Currently simMatch() will simulate the match in its entirety and update the league table. But there are functions that can be used to see the timeline of a match as it happens. In future builds, the user will be able to take charge of a particular team and see the events of any game that he is involved in live.&nbsp;</p>\n<p><br />```<br />You will need to install packages specified in requirements.txt, you can do this by -<br />pip install -r requirements.txt<br />```<br /># The following is a sample output</p>\n<p>![Screenshot (2)](https://user-images.githubusercontent.com/55048030/84644685-1b96c700-af1d-11ea-81af-6ea056cbdea5.png)</p>\n<p>Please feel free to play around with the code and let me know if you find any issues or you need some help with certain functions</p>\n<p>You can contact me at allen.thomas.dev@gmail.com</p>\n</body>\n</html>	t	0	2020-07-05 09:16:05.523+00	2020-07-05 09:16:05.523+00	fxYsuufsb	mD4BkGzyk	\N	2020-07-05 09:31:38.102+00	\N
