hf5sJzx1K	Source Code to find resolution of JPEG Image	<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body style="font-size: 16px;">\n<p>This code opens the image in binary mode.</p>\n<pre class="language-python"><code>def jpeg_res(filename):\n   """"This function prints the resolution of the jpeg image file passed into it"""\n\n   # open image for reading in binary mode\n   with open(filename,'rb') as img_file:\n\n       # height of image (in 2 bytes) is at 164th position\n       img_file.seek(163)\n\n       # read the 2 bytes\n       a = img_file.read(2)\n\n       # calculate height\n       height = (a[0] &lt;&lt; 8) + a[1]\n\n       # next 2 bytes is width\n       a = img_file.read(2)\n\n       # calculate width\n       width = (a[0] &lt;&lt; 8) + a[1]\n\n   print("The resolution of the image is",width,"x",height)\n\njpeg_res("img1.jpg")</code></pre>\n<p>&nbsp;</p>\n<p><strong>Output</strong></p>\n<pre class="language-python"><code>The resolution of the image is 280 x 280</code></pre>\n</body>\n</html>	f	0	2020-07-04 15:04:45.302+00	2020-07-18 15:14:06.591+00	HEr8YaUEf	mD4BkGzyk	\N	\N	\N
