57cScCsCZ	Blockchain-based Grievance Redressal	<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body style="font-size: 16px;">\n<p><iframe src="https://www.youtube.com/embed/iDnYNhZOzJE" width="800" height="449" allowfullscreen="allowfullscreen"></iframe></p>\n<p>&nbsp;</p>\n<p><strong>Blockchain-based Grievance Redressal</strong></p>\n<p>&nbsp;</p>\n<p>Grievance refers to an official statement of a complaint about something believed to be wrong or unfair and hence Grievance Redressal refers to the resolution of these complaints.</p>\n<p>&nbsp;</p>\n<p>While many institutes, organizations, companies, etc follow their own designed escalation matrix, it is quite unorganized from a grievant's perspective. Escalation matrix is nothing but a hierarchy defined by an organization to resolve their customer or stakeholder issues.&nbsp;</p>\n<p>As a result, there needs to be a solution that is transparent to the users while keeping their problems a top priority.&nbsp;&nbsp;</p>\n<p>&nbsp;</p>\n<p>As a part of our BE project, we decided to solve this using blockchain's fundamentals as our primary approach. Data Integrity, Transparency, Immutability, etc help us leverage the power of blockchain in order to provide full control to the user. The proposed solution is nothing but a hierarchical traversal of grievances.</p>\n<p>&nbsp;</p>\n<p>A grievance submitted goes through different levels in the hierarchy defined in the escalation matrix whilst keeping track of updates over the complaint. Actors responsible for resolving the grievances have a stipulated timeframe failure of which the grievance is automatically forwarded to the next level in the hierarchy. Apart from this, grievants satisfaction is also taken into account once a solution is provided.</p>\n<p>&nbsp;</p>\n<p>Attached vide is a use case for an institute with 3 levels of hierarchy.</p>\n</body>\n</html>	t	0	2020-07-18 11:05:35.68+00	2020-07-18 11:36:23.448+00	4XkLf4H3S	4LBaGgdaS	\N	\N	\N
