sUBjXdhWL	LyricViz - Generating self-similarity matrices to visualize lyrics	<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body style="font-size: 16px;">\n<p><a href="https://lyricviz.herokuapp.com/" target="_blank" rel="noopener"><strong>LyricViz </strong></a>uses <a href="https://en.wikipedia.org/wiki/Self-similarity_matrix">self-similarity matrices</a> to visualize patterns of repetition in text</p>\n<p>&nbsp;</p>\n<p>Confused? Check out this image, which walks through the example of "Barbie World" by Aqua.</p>\n<p>A self-similarity matrix is used to answer the question "which parts of this thing are alike?"</p>\n<p>Each row and column of the matrix corresponds to a word in a text. This 8 x 8 matrix represents the 8 words of the lyric. The cell at (x, y) is filled in if the xth word and the yth word are the same.</p>\n<p>&nbsp;</p>\n<p><video style="display: block; margin-left: auto; margin-right: auto;" controls="controls" width="400" height="400">\n<source src="https://i.imgur.com/DUoWS9n.mp4" type="video/mp4" /></video><br />&nbsp;</p>\n<p>&nbsp;</p>\n<p>The diagonal running from top-left to bottom-right (the "main diagonal") corresponds to cases where x=y, and is always filled in. The portions on either side of it are symmetric.</p>\n<div class="col-xs-12 col-lg-7">\n<p>&nbsp;</p>\n</div>\n<p>Each point on the X-Axis and Y-Axis is a word from the lyrics of a song. If the words on the X-Axis and Y-Axis are the same, then the cell at (x,y) is highlighted.</p>\n<p><a href="https://lyricviz.herokuapp.com/"><strong>LyricViz </strong></a>has been deployed to a Heroku server and can be found <a href="https://lyricviz.herokuapp.com/"><span style="text-decoration: underline;"><strong>here</strong></span></a></p>\n<p><strong>This is <span style="text-decoration: underline;">directly inspired</span> by Colin Morris' work on SongSim.</strong></p>\n<p>&nbsp;</p>\n<p>While SongSim is an amazing piece of software, there were certain gripes that I had with it.</p>\n<p>Mainly-</p>\n<ol>\n<li><span style="background-color: #34495e;">You can't dynamically search for different songs.</span></li>\n<li><span style="background-color: #34495e;">You cannot zoom into the HeatMap which leads to confusing visualisations.</span></li>\n<li><span style="background-color: #34495e;">The severe lack of colorschemes</span></li>\n</ol>\n<p>&nbsp;</p>\n<p>These are some of the issues that I have aimed to solve.</p>\n<p>&nbsp;</p>\n<p>I am using Dash with Python, which is used to create highly customisable, interactive graphs and webapps.The heatmaps are dynamically updateable as well as interactive.</p>\n<p>&nbsp;</p>\n<p>Using BeautifulSoup and request libraries for Python, the users can enter the names of songs that the want to visualise and the lyrics of input song is scraped from metrolyrics.com</p>\n<p>In case for some reason, the song cannot be searched, the user can also simply copy/paste the metrolyrics url into the given input field.</p>\n<p>I chose metrolyrics because they have <span class="st">1000000+ lyrics from 20000 artists.</span></p>\n<p>&nbsp;</p>\n<p><span class="st">Coming to the colorschemes, I have included a staggering 90+ themes that one can choose from. I'm also working on allowing the users to create their own colorschemes.</span></p>\n<p>&nbsp;</p>\n<p>Different songs have diferent lyrical themes- check out Lady Gaga's "Bad Romance" for instance-</p>\n<p><video style="display: block; margin-left: auto; margin-right: auto;" controls="controls" width="300" height="300">\n<source src="https://i.imgur.com/LzLczNV.mp4" type="video/mp4" /></video></p>\n<p>&nbsp;</p>\n<p><video style="display: block; margin-left: auto; margin-right: auto;" controls="controls" width="300" height="300">\n<source src="https://i.imgur.com/zAVHcPr.mp4" type="video/mp4" /></video></p>\n<p>&nbsp;</p>\n<p>Or you can take a look at Vince Staple's "Yeah Right" -</p>\n<p>Because of the highly repetitive lyrics we can see "blocks" forming in the matrix-</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><video style="display: block; margin-left: auto; margin-right: auto;" controls="controls" width="300" height="300">\n<source src="https://i.imgur.com/JEBSYtX.mp4" type="video/mp4" /></video></p>\n<p>&nbsp;</p>\n<p><a href="https://lyricviz.herokuapp.com/">https://lyricviz.herokuapp.com/</a></p>\n<p>Finally, this is <a href="https://lyricviz.herokuapp.com/"><strong>LyricViz </strong></a>in action-</p>\n<p><iframe src="https://www.youtube.com/embed/15I9K7VRQBI" width="900" height="505" allowfullscreen="allowfullscreen"></iframe></p>\n</body>\n</html>	t	0	2020-07-23 18:33:41.389+00	2020-07-24 15:58:30.809+00	fxYsuufsb	mD4BkGzyk	\N	2020-07-24 16:18:52.586+00	\N
