e lyrics we can see "blocks" forming in the matrix-</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><video style="display: block; margin-left: auto; margin-right: auto;" controls="controls" width="300" height="300" data-mce-fragment="1">\n<source src="https://i.imgur.com/JEBSYtX.mp4" type="video/mp4" /></video></p>\n<p>&nbsp;</p>\n<p><a href="https://lyricviz.herokuapp.com/">https://lyricviz.herokuapp.com/</a></p>\n<p>Finally, this is <a href="https://lyricviz.herokuapp.com/"><strong>LyricViz </strong></a>in action-</p>\n<p><iframe src="https://www.youtube.com/embed/15I9K7VRQBI" width="900" height="505" allowfullscreen="allowfullscreen" data-mce-fragment="1"></iframe></p>\n</body>\n</html>	t	0	2020-07-24 16:14:48.999+00	2020-07-24 16:19:02.635+00	fxYsuufsb	mD4BkGzyk	\N	\N	TVSZmuRrr
