iaXAqUdym	Drowsiness Detection	<!DOCTYPE html>\n<html>\n<head>\n</head>\n<body style="font-size: 16px;">\n<p>We know that many road accidents are caused by the driver who goes into sleep mode while driving. So here we are with the solution:</p>\n<ul>\n<li>It detects the face of the driver and preprocesses the driver&rsquo;s image.</li>\n<li>It detects the eyes whether they are closed or not.</li>\n<li>If the eyes remain closed for more than 15 seconds, it beeps with a red-colored border.</li>\n<li>By this, we can alert the driver and the accidents can be prevented.</li>\n</ul>\n<p>&nbsp;</p>\n<p>PS: A teacher can use it in lectures to know whether the students are sleeping or not!</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n</body>\n</html>	f	0	2020-07-25 14:10:12.011+00	2020-07-25 14:14:55.755+00	98Y3G5yTx	mD4BkGzyk	\N	\N	TVSZmuRrr
